class UmHymnsEspirituSand{
  static List<HymnsContent> list = [
    HymnsContent(id: 1945, position: 1, content: "Enju, a Spiritu Sandu,\nLutanya wove wokilu.\nOve Usungu, tu ku kuama,\nO suñamisa itima.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_83, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1946, position: 2, content: "Ndo tu longise ondaka\nYina yocili yohenda.\nTu ihe usumba wa Suku,\nKa tu ka kuate kakandu.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_83, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1947, position: 3, content: "Ndo tu lekise onjila,\nYa suñamela kesunga,\nHa tu lisangi la Yesu,\nUngombo wetu wokilu.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_83, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1948, position: 4, content: "Ndo tu songuile lohenda,\nTe tua pitila ku Suku.\nOko tu sanga esanju,\nTu puyukila kulamba.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_83, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1949, position: 1, content: "A Spiritu Ukuahenda,\nTu livela oviali viove,\nPuãi pokati kavio viosi,\nTu ĩhe ocisola.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_84, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1950, position: 2, content: "Nda tu popia alimi a lua;\nTu imba owanji nduprofeto,\nKa ci silivila cimue,\nTe nda locisola.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_84, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1951, position: 3, content: "Onya loku litambela,\nViosi vi pue kovitima,\nLolombonde le vi imuhe;\nTu ĩhe ocisola.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_84, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1952, position: 4, content: "Ocisola nda cocili\nKa ci patakaila onyeño;\nCi lingainga vosi ohenda;\nTu ĩhe ocisola.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_84, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1953, position: 5, content: "Ocisola nda cocili,\nKa ci tepoloka vali.\nA Spiritu Ukuahenda,\nTu ĩhe ocisola.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_84, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1954, position: 1, content: "A Spiritu liutanya,\nO yelaisa itima,\nNdo nyimule upeke,\nHã si leta ocili.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_85, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1955, position: 2, content: "A Spiritu liutanya,\nO Kolaisa itima,\nNda konyoha osimbu;\nNyihe vali ongusu.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_85, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1956, position: 3, content: "A Spiritu liutanya,\nO sanjuaisa itima,\nNdo mopele kohali;\nSumuluhe ocili.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_85, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1957, position: 4, content: "A Spiritu liutanya,\nNdo numãle vutima;\nImulamo eviho;\nSunguluke ocili.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_85, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1958, position: 1, content: "A Spiritu, ove Usongui,\nNdo songuile kuosi o panga.\nNyihe okuokuo, hu kuatelele,\nMomo mita vekalasoko.\nNda o njupa ocilulumo,\nNda hu yeva, a Spiritu,\nO mañinya huti, Enju,\nHu songuile; ku ka yokoke.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_86, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1959, position: 2, content: "Kala lame, a Ñala yohenda,\nSi endi love kuosi o songuila.\nKu ka siepo, ñuete usumba;\nOwelema wa njokokisa.\nKulo kilu lieve mapata,\nSanga haiko ndi nyelela.\nNdo mañinye huti, Enju,\nHu songuile; ku ka yokoke.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_86, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1960, position: 3, content: "Eci njoka olui luonguele,\nOlui luna lua sulako,\nNdinge ohenda; nule utima;\nSanga mbomba; ngenda lovava,\nKuenje si pitila kesanju,\nLina liove ko Kanana.\nNdo mañinye, huti, Enju,\nHu songuile ku ka yokoke.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_86, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1961, position: 1, content: "A Spiritu, Ukuonene,\nMuise epondolo liove.\nEvi viove vi ñolise;\nHã si amiko lekolelo.\nNyihe epandi lioku vumba\nÑala yange wa mopela.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_87, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1962, position: 2, content: "A Spiritu, Ukuacili,\nSunguluisa utima wange.\nUwa wove u sambukile;\nU mosuise ovisimilo.\nEvi vivi nda vi njonja\nSokolole esunga liove.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_87, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1963, position: 3, content: "A Spiritu Ukuahenda,\nLame ndinge ukuahenda.\nOcisola conjovoli,\nCi muiwe kovitua viange.\nKolondaka viange viosi\nKu yevale ondaka yaye.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_87, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1964, position: 4, content: "A Spiritu Ukuambembua,\nNdo nyimule esuvu liosi.\nApa pa li utuni lonya,\nPiñainyapo ocisola.\nNjivaluise ongecelo\nYa muisilua kekulusu.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_87, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1965, position: 1, content: "Enju a Spiritu likola\nUlongisi Unene;\nNdo lekise itima vietu\nKristu Upopeli", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_88, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1966, content: "A Yesu, a Yesu,\nTu yevelele;\nUnene locisola cove\nVi tu viale hu.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_88, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1967, position: 2, content: "Enju o nyole oviseveto\nViombembua yesanda;\nEca kokuava va nyelela,\nEpopelo liove.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_88, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1968, position: 3, content: "Enju o yukise Ekongelo\nLongusu locinyi;\nEnju kokela va nyelela,\nKu Ñala Yesu.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_88, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1969, position: 4, content: "Ovilimbu viove vi kola\nVikoke omanu; \nEcavo esumuluho liaco\nKokuetu vosi.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_88, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1970, position: 1, content: "Cime cetu poku usika,\nWa tu iha ocali;\nSpiritu Sandu ha lingi,\nOñuatisi.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_89, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1971, position: 2, content: "Wo tuma ha tu tuwisa,\nEsunga lia Suku;\nCinene nda tu kolela,\nUnene wa'e.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_89, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1972, position: 3, content: "O tu avelavo ongusu,\nYoku yula akandu;\nO tu longisa uloño,\nWusoma wa'e.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_89, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1973, position: 4, content: "Nda kuiya oku pambuka,\nVonjila yomuenyo;\nOndaka ya'e yocisola,\nYi tu tiula.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_89, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1974, position: 5, content: "A Spiritu ukuonene,\nNdo  tu sunguluise;\nNdo tu ivaluise okufa,\nKuonjovoli.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_89, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1975, position: 6, content: "Tu siakãlele ondalu,\nYombili lesunga;\nItima vietu vi linge,\nOnjo yove.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_89, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1976, position: 1, content: "Enju a Spiritu li kola,\nUkuonene locisola;\nMolehisa ocisola\nKutima wa suka ño.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_90, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1977, position: 2, content: "Enju ndo ndekise ulamba\nWa Yesu Upopeli;\nOku fa kua’e kua nena voluali\nUnene waye wocisola.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_90, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1978, position: 3, content: "Kumue locali ci nene\nKuenda ulamba wove wa lua,\nYukisa vutima wange\nOcisola cove ca lua.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_90, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1979, position: 4, content: "Omanu va kava, va sumua,\nHaivo veyuka lusumba;\nOcisola cove ci kola,\nCi va kokele oku ku kuama.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_90, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1980, position: 1, content: "A Spiritu songuile,\nVolongenda viomuenyo,\nNjimbe onumbi eteke keteke;\nKuenda ndekaise omo ndinga.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_91, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1981, position: 2, content: "Kolotembo viohele,\nNdingise onõi yocili,\nMbundise vonete yove;\nOmo mua koka ocili.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_91, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1982, position: 3, content: "Eci ku iya ayonjo,\nNdo pamise, a Suku,\nNdaño ñasi lika liange;\nSi ka konyohe kokuove.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_91, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1983, position: 4, content: "Sunguluke ocili,\nVomuenyo u wa kulo,\nLeci omuenyo ulo u pua,\nÑale l’Ove otembo ka yi pui.", hymnsNumber: UmHymnsNumberSeeder.ESPIRITU_SAND_91, typeStanza: HymnsContentCode.VERSE),

  ];
